import React from 'react'

class Card extends React.Component{
    render(){
        return(
            <div className="Card">
                <img src = "https://www.freecodecamp.org/news/content/images/2021/06/Ekran-Resmi-2019-11-18-18.08.13.png" width="200px" height="200px"/>
                <p>Test</p>
                <button className='Button'>x</button>
            </div>
        )
    }
}

class ButtonForm extends React.Component{
    render(){
        return(
            <div>
                <button>Open Dialog</button>
            </div>
        )
    }
}

class Form extends React.Component{
    render(){
        return(
            <div>
                <form>
                    <fieldset>
                        <input placeholder="Enter Picture link Here"/>
                        <input placeholder="Enter Caption Here"/>
                        <button>Accept</button>
                        <button>Cancel</button>
                    </fieldset>
                </form>
            </div>
        )
    }
}

class Left extends React.Component{
    render(){
        return (
            <div className="columnLeft">
                <ButtonForm/>
                <Form/>
            </div>

        )
    }
}

class Right extends React.Component{
    render(){
        return(
            <div className='columnRight'>
                <Card/>
                <Card/>
                <Card/>
            </div>
        )
    }
}

class App extends React.Component{
    render(){
        return(
            <div>
                <Left/>
                <Right/>
            </div>
        )
    }
}

export default App;
